import React from 'react';
import { Link } from 'react-router-dom';

import Routes from '../../config/name.routes';
import Slidebar from './Slidebar';

interface propsToolbar {
  heightVh: number;
}

const Toolbar = ({ heightVh }: propsToolbar) => {
  return (
    <header
      className="w-full h-14 bg-blue-500 flex items-center lg:justify-center"
      style={{ height: `${heightVh}vh`, minHeight: 56 }}
    >
      <div className="lg:hidden">
        <Slidebar />
      </div>
      <div className="absolute flex items-center justify-center w-full lg:w-11/12">
        <h1 className="text-xl font-bold text-white lg:text-center lg:whitespace-nowrap">
          <Link title="Home" to="/">Calculadora de Teoria de Colas</Link>
        </h1>
        <div className="hidden lg:flex lg:w-full lg:justify-end lg:items-center">
          <NavItem name="Theory" route={Routes.theory} />
          <NavItem name="About" route={Routes.about} />
          <NavItem name="Theory" route={Routes.theory} />
          <NavItem name="About" route={Routes.about} />
          <a
            title="GitHub repository"
            className="hover:text-white"
            href="https://github.com/PepVal/queueing-theory-calculator"
            target="_blank"
            rel="noreferrer"
          >
            <svg className="w-10 h-10" viewBox="0 0 24 24">
              <path
                fill="currentColor"
                d="M12,2A10,10 0 0,0 2,12C2,16.42 4.87,20.17 8.84,21.5C9.34,21.58 9.5,21.27 9.5,21C9.5,20.77 9.5,20.14 9.5,19.31C6.73,19.91 6.14,17.97 6.14,17.97C5.68,16.81 5.03,16.5 5.03,16.5C4.12,15.88 5.1,15.9 5.1,15.9C6.1,15.97 6.63,16.93 6.63,16.93C7.5,18.45 8.97,18 9.54,17.76C9.63,17.11 9.89,16.67 10.17,16.42C7.95,16.17 5.62,15.31 5.62,11.5C5.62,10.39 6,9.5 6.65,8.79C6.55,8.54 6.2,7.5 6.75,6.15C6.75,6.15 7.59,5.88 9.5,7.17C10.29,6.95 11.15,6.84 12,6.84C12.85,6.84 13.71,6.95 14.5,7.17C16.41,5.88 17.25,6.15 17.25,6.15C17.8,7.5 17.45,8.54 17.35,8.79C18,9.5 18.38,10.39 18.38,11.5C18.38,15.32 16.04,16.16 13.81,16.41C14.17,16.72 14.5,17.33 14.5,18.26C14.5,19.6 14.5,20.68 14.5,21C14.5,21.27 14.66,21.59 15.17,21.5C19.14,20.16 22,16.42 22,12A10,10 0 0,0 12,2Z"
              />
            </svg>
          </a>
        </div>
      </div>
    </header>
  );
};

interface NavItemProps {
  name: string;
  route: string;
}

const NavItem = ({ name, route }: NavItemProps) => {
  return (
    <Link
      title={name}
      className={`px-4 font-medium text-white py-8 rounded-sm
      hover:bg-opacity-20 hover:bg-white
      `}
      to={route}
    >
      <p>{name}</p>
    </Link>
  );
};

export default Toolbar;
